import XCTest
import CNKit

class FloorTests: XCTestCase {
    func testDecoding() {
        let json = floorJSON.data(using: .utf8)!

        let decoded = try! JSONDecoder().decode([Floor].self, from: json)
        XCTAssertEqual(decoded.count, 1)

        let groundfloor = decoded[0]

        XCTAssertEqual(groundfloor.level, 0)
        XCTAssertEqual(groundfloor.maxX, 737, accuracy: 1)
        XCTAssertEqual(groundfloor.maxY, 479, accuracy: 1)
        XCTAssertEqual(groundfloor.rooms.count, 88)

        let e023 = groundfloor.rooms.first { $0.name == "E023" }!

        XCTAssertEqual(e023.id, "542100.2310")
        XCTAssertEqual(e023.name, "E023") // not a really useful test...
        XCTAssertEqual(e023.nameLocation!.0, 398, accuracy: 1)
        XCTAssertEqual(e023.nameLocation!.1, 347, accuracy: 1)
        XCTAssertEqual(e023.points.count, 21)
        XCTAssertEqual(e023.points[0].0, 354, accuracy: 1)
        XCTAssertEqual(e023.points[0].1, 292, accuracy: 1)
        XCTAssert(e023.isLectureHall)
        XCTAssertEqual(e023.type, .seminarroom) // this is factually wrong, but it's what the data says
    }

    func testFetch() {
        let e = expectation(description: "get data")

        Floor.fetch(forBuilding: "APB") { result in
            guard let floors = result.success else {
                XCTFail("got error: \(result)")
                e.fulfill()
                return
            }

            XCTAssertEqual(floors.count, 5)
            e.fulfill()
        }

        waitForExpectations(timeout: 5)
    }

    static var allTests = [
        ("testDecoding", testDecoding),
        ("testFetch", testFetch),
    ]
}

